import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [url, setUrl] = useState('');

  const submitUrl = (e) => {
    e.preventDefault();
  };

  const renderSearchBar = () => {
    return (
      <div>
        <input
          type='text'
          value={url}
          onChange={(e) => {
            setUrl(e.target.value);
          }}
          placeholder='Paste listing URL'></input>
        <button
          type='submit'
          onClick={(e) => {
            submitUrl(e);
          }}>
          Submit
        </button>
      </div>
    );
  };

  return <div className='App'>{renderSearchBar()}</div>;
}

export default App;
